import React from "react";

export const ContactPicker = ({ handleChange, contacts }) => {

  return (
    <>
      <select
        name='name'
        onChange={handleChange}
        value={contacts.name}
        required
      >
        <option value=''>Choose contact</option>
        {contacts.map((contact, index) => <option key={index}>{contact.name}</option>)}
      </select>
    </>
  );
};
